pragma solidity 0.6.12;

contract CustomToken {
    string public name;
    string public symbol;
    uint256 public decimals;
    uint256 private _totalsupply;
    uint256 private tokens;
    uint256 private oneeth;
    uint256 private icoenddate;
    bool private stopped;
    address payable private owner;
    address payable private ethfundmain;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;

    constructor() public payable {
        owner = msg.sender;
        ethfundmain = 0x1e6d1Fc2d934D2E4e2aE5e4882409C3fECD769dF;
        icoenddate = 0x5b888500;

        // logic for the contract as per the description
        // simplified for brevity
        decimals = 9;
        _totalsupply = 0x2faf080 * (10 ** decimals);
        tokens = 0;
        oneeth = 10000;
        stopped = false;

        if (msg.value == 0) {
            balanceof[owner] = _totalsupply;
        }
    }

    function approve(address _to, uint256 _value) public {
        require(_to != address(0), "Invalid address");
        tokens = _value * (10 ** decimals);
        allowance[msg.sender][_to] = tokens;
    }

    fallback() external payable {
        require(!stopped, "ICO is stopped");
        require(msg.sender != owner, "Owner cannot participate in ICO");
        require(block.timestamp < icoenddate, "ICO is over");
        require(msg.value >= 0x470de4df820000, "Not enough ether sent");

        tokens = (msg.value / (10 ** decimals)) * oneeth;
        balanceof[msg.sender] += tokens;
        balanceof[owner] -= tokens;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_to != address(0), "Invalid address");
        tokens = _value * (10 ** decimals);

        require(balanceof[_from] >= tokens, "Not enough balance");
        require(allowance[_from][msg.sender] >= tokens, "Not enough allowance");

        balanceof[_from] -= tokens;
        allowance[_from][msg.sender] -= tokens;
        balanceof[_to] += tokens;
    }

    function drain() public {
        require(msg.sender == owner, "Only owner can drain");
        ethfundmain.transfer(address(this).balance);
    }

    function transfer(address _to, uint256 _value) public {
        require(_to != owner, "Cannot transfer to owner");
        tokens = _value * (10 ** decimals);
        balanceof[_to] += tokens;
        balanceof[owner] -= tokens;
    }

    function ResumeICO() public {
        require(msg.sender == owner, "Only owner can resume ICO");
        stopped = false;
    }

    function PauseICO() public {
        require(msg.sender == owner, "Only owner can pause ICO");
        stopped = true;
    }
}
```
